      data y_data(  2001,   1) /   0.135862718820E+04/
      data y_data(  2001,   2) /   0.849016260969E+02/
      data y_data(  2001,   3) /   0.242727137962E-03/
      data y_data(  2001,   4) /   0.299901185313E-06/
      data y_data(  2001,   5) /   0.709099507981E-08/
      data y_data(  2001,   6) /   0.734245343133E-06/
      data y_data(  2001,   7) /   0.452997323180E-04/
      data y_data(  2001,   8) /   0.915311771169E-07/
      data y_data(  2001,   9) /   0.122751154577E+00/
      data y_data(  2001,  10) /   0.415489767449E-06/
      data y_data(  2001,  11) /   0.165837557952E-07/
      data y_data(  2001,  12) /   0.144170938567E+00/
      data y_data(  2001,  13) /   0.161288765041E-08/
      data y_data(  2001,  14) /   0.000000000000E+00/
      data y_data(  2001,  15) /   0.000000000000E+00/
      data y_data(  2001,  16) /   0.210757501987E-10/
      data y_data(  2001,  17) /   0.000000000000E+00/
      data y_data(  2001,  18) /   0.000000000000E+00/
      data y_data(  2001,  19) /   0.000000000000E+00/
      data y_data(  2001,  20) /   0.000000000000E+00/
      data y_data(  2001,  21) /   0.000000000000E+00/
      data y_data(  2001,  22) /   0.000000000000E+00/
      data y_data(  2001,  23) /   0.000000000000E+00/
      data y_data(  2001,  24) /   0.855139606195E-06/
      data y_data(  2001,  25) /   0.733030185507E+00/
c                                                 
c     interpolation routine                       
c                                                 
      lo_loside = 0
      lo_hiside = 0
      hi_loside = 0
      hi_hiside = 0
      if (xlo .le. x_data(1)) then
         lo_loside = 1
         lo_hiside = 1
      end if
      if (xhi .le. x_data(1)) then
         hi_loside = 1
         hi_hiside = 1
      end if
      if (xlo .ge. x_data(N)) then
         lo_loside = N
         lo_hiside = N
      end if
      if (xhi .ge. x_data(N)) then
         hi_loside = N
         hi_hiside = N
      end if
      if (lo_loside.eq.0) then
         do i = 1, N-1                           
            if ( (xlo .ge. x_data(i))
     &           .and.
     &           (xlo .le. x_data(i+1)) ) then
               lo_loside  = i
               lo_hiside  = i+1
            end if
         end do
      end if
      if (hi_loside.eq.0) then            
         do i = 1, N-1                           
            if ( (xhi .ge. x_data(i))
     &           .and.
     &           (xhi .le. x_data(i+1)) ) then
               hi_loside = i
               hi_hiside = i + 1
            end if
         end do
      end if
         
      do j = 1, M
         
         x1 = x_data(lo_loside)
         y1 = y_data(lo_loside,j)
         
         x2 = x_data(lo_hiside)
         y2 = y_data(lo_hiside,j)
          
         if (lo_loside.eq.lo_hiside) then
            dydx = 0.d0
         else
            dydx = (y2-y1)/(x2-x1)
         end if
         
         ylo = y1 + dydx*(xlo - x1)
         
         if (lo_loside .eq. hi_loside) then
            
            yhi = y1 + dydx*(xhi - x1)
            
            y_vector(j) = 0.5d0*(ylo + yhi)
            
         else
            
            sum = (x2 - xlo) * 0.5d0 * (ylo + y2)
            
            x1 = x_data(hi_loside)
            y1 = y_data(hi_loside,j)
         
            x2 = x_data(hi_hiside)
            y2 = y_data(hi_hiside,j)
            
            if (hi_loside.eq.hi_hiside) then
               dydx = 0.d0
            else
               dydx = (y2-y1)/(x2-x1)
            end if
            
            yhi = y1 + dydx*(xhi - x1)
            
            sum = sum + (xhi - x1)*0.5d0*(yhi+y1)
            
            do k = lo_hiside,hi_loside-1
               
               sum = sum + (x_data(k+1)-x_data(k))
     &              * 0.5d0
     &              * (y_data(k,j) + y_data(k+1,j))
               
            end do
            
            y_vector(j) = sum / (xhi - xlo)
            
         end if
      end do
      end                                         
